import React from "react";
import "./Logreg.css";

function Reg(){

    return(
        <form className="page" action="http://localhost:5000/api/user/feltolt" method="post">
        <div className="reglog">

        </div>
            <input type="email" id="email" placeholder="e-mail cím..." name="email"/>
            <input type="text" id="nev" placeholder="felhasználónév..." name="nev"/>
            <input type="password" id="password" placeholder="jelszó..." name="password"/>
            <button type="submit" >Regisztrálás</button>
        </form>
    );
}
export default Reg;
